import React from "react";
import "./ProductReviewDisplay.css";
function ProductReviewDisplay() {
  return (
    <div>
      <br />
      <br />
      <hr style={{ marginLeft: "5%", marginRight: "5%" }} />
      <div>
        <h3>Aslam Youseph</h3>
        <p>Its a good and intresting laptop i ever see</p>
      </div>
    </div>
  );
}

export default ProductReviewDisplay;
